import React from 'react';
import { AppBar, Toolbar, Typography} from '@material-ui/core';
// import AccountBoxIcon from '@material-ui/icons/AccountBox';
import { makeStyles } from '@material-ui/styles';
import Avatar from '@material-ui/core/Avatar';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';


// import classes from '*.module.css';

const useStyles = makeStyles(()=> ({
    header : {
        fontSize: '1.3rem',
        fontWeight: "bold"
    },
    links : {
        fontSize: '1rem'
    },
    flexRight: {
        flex: 1
    }

}))
const Navbar = () => {
    const classes = useStyles();
    return (

            <AppBar position="static">
                <Container maxWidth="lg">
                <Toolbar>
                    <Box className = {classes.flexRight} display="flex" flexDirection="row" p={1} m={1}>
                        <Box m={2}><Typography className = {classes.header}>LooseFood</Typography></Box>
                        <Box m={2}><Typography className = {classes.header}>About Us </Typography></Box>
                        <Box m={2}><Typography className = {classes.header}>PrepMe</Typography></Box>
                    </Box>

                    <Avatar>A</Avatar>
                </Toolbar>
                </Container>
            </AppBar>


    )
};

export default Navbar;
